query userCollection {
  collection {
    tracks {
      artistTemplate
    artistNames
    childParam
    artists {
      id
      title
      image {
        src
        palette
      }
    }
    hasFlac
    zchan
    lyrics
    title
    searchTitle
    explicit
    credits
    availability
    position
    duration
    id
    condition
    release {
      id
      genres {
        name
      }
      title
      image {
        src
        palette
        palette_bottom: paletteBottom
      }
    }
    searchTitle
    title
    }
  }
}
